import React from "react";
import EnfantSlider from "./EnfantSlider";
import { AiOutlinePlusSquare } from 'react-icons/ai';




const GstEnfants = () => {
  return (
    <div className="font-inter">
      <div className="max-w-[1000px] mt-[5]  mx-auto text-center flex flex-col justify-center text-[#0B0C38] font-inter ">

        <h1 className=" md:text-7xl sm:text-6xl text-4xl font-bold md:py-6 font-concert ">
          Espace Parent
        </h1>

      </div>

      <div className="  w-[90%] grid grid-cols-2 justify-center  items-center border-b-2 border-red-100 border-t-2 my-3 ">



        <h4 className=" md:text-4xl sm:text-3xl text-2xl font-bold md:py-6 font-concert text-start ">
          <li>Mes enfants </li>
        </h4>
        <button className="bg-[#FB9B90] w-[20%] ml-[80%]  text-center rounded-md font-medium  px-6 py-3 text-[#191A43] ring-2 ring-[#ED6361] hover:bg-[#5B112B] hover:text-white hover:scale-105 duration-300">

          Ajouter
        </button>





      </div>

      <EnfantSlider />




    </div>
  )
}

export default GstEnfants;
